(function () {
    if (location.pathname !== '/game.php' || !/[a-z0-9.]{3,}\.the-west(\.[a-z]{2,3}){1,2}/i.test(location.hostname))
        return null;

    function main() {
        insertScripts();
        paintStyles();
    }

    function content() {
        return (function (meta, strings) {
            var labels = strings.split('|');
            window.fList = {
                header: JSON.parse(meta),
                script: TheWestApi.register('fList', 'Friends List', '2.07', '2.89', 'Almighty Brown Tie', 'http://forum.the-west.net'),
                addTab: function () {
                    var container = $('<div>', { 'class': 'friend' });
                    var content = $('<div>', { 'class': 'chat_channel', 'id': 'no_friends' });
                    $("#ui_chat > .container .listwrap").prepend(container);
                    container.prepend(content);
                    $("#no_friends").append(new west.gui.Button(labels[0], function () {
                        FriendslistWindow.open();
                    }).getMainDiv());
                    var tab = $('<div>', { 'class': 'friends' }).text(labels[1]);
                    $("#ui_chat > .tabs").append(tab);
                },
                addToggle: function () {
                    WestUi.Chat.toggleChat = function () {
                        $('#ui_chat > .tabs').toggleClass('friends');
                        $('#ui_chat > .tabs > .friends').toggleClass('active');
                        $('#ui_chat > .tabs > .general').toggleClass('active');
                        $('#ui_chat > .container .general').toggle();
                        $('#ui_chat > .container .friend').toggle();
                    }
                    $("#ui_chat > .tabs").click(WestUi.Chat.toggleChat);
                },
                setGui: function () {
                    this.script.setGui('<p>' + this.header.desc + '</p><br /><dl>\
                    <dt>Version</dt> <dd>' + this.header.version + '</dd>\
                    <dt>Runs At</dt> <dd>' + this.header.runs + '</dd>\
                    <dt>Updates</dt> <dd>' + this.header.updates + '</dd></dl>\
                ');
                },
                init: function () {
                    this.addTab();
                    this.addToggle();
                    this.setGui();
                }
            };
            window.fList.init();
        }).toString();
    }

    function meta() {
        if (typeof GM_info === 'object') {
            return JSON.stringify({
                desc: GM_info.script.description,
                version: GM_info.script.version,
                runs: GM_info.script.includes.join(', '),
                updates: GM_info.scriptWillUpdate
            });
        } else
            return JSON.stringify({ desc: 'Please install the latest version of GreaseMonkey or TamperMonkey!' });
    }

    function genStrings() {
        return {
            net: ['Invite friend', 'Friends'],
            de: ['Freund einladen', 'Freunde'],
            cz: ['Pozvat přítele', 'Přátelé'],
            dk: ['Inviter ven', 'Venner'],
            gr: ['Πρόσκληση φίλων', 'Φίλοι'],
            es: ['Invita amigos', 'Amigos'],
            fr: ['Invite tes amis', 'Amis'],
            hu: ['Barátok meghívása', 'Barátok'],
            it: ['Invita amico', 'Amici'],
            nl: ['Nodig vriend uit', 'Vrienden'],
            no: ['Inviter venner', 'Venner'],
            pl: ['Zaproś znajomego', 'Znajomi'],
            br: ['Convidar amigo', 'Amigos'],
            pt: ['Convidar amigo', 'Amigos'],
            ro: ['Invită un prieten', 'Prieteni'],
            ru: ['Пригласи знакомого', 'Друзья'],
            sk: ['Pozvať kamaráta', 'Priatelia'],
            se: ['Bjud in vän', 'Vänner'],
            org: ['Arkadaş davet et', 'Arkadaşlar']
        };
    }

    function localStrings() {
        var strings = genStrings();
        var url = location.hostname.split('.');
        for (var i = url.length; i > 0; --i)
            if (typeof strings[url[i]] === 'object')
                return strings[url[i]].join('|');
        return strings.en.join('|');
    }

    function insertScripts() {
        var injector = document.createElement('script');
        injector.setAttribute('type', 'text/javascript');
        injector.textContent = "$(document).ready(" + content() + ".bind(window, '" + meta() + "', '" + localStrings() + "'));";
        document.head.appendChild(injector);
    }

    function style() {
        var images = [
            'data:image/png;base64,',
            'data:image/png;base64,',
            'data:image/png;base64,',
            'data:image/png;base64,',
            'data:image/png;base64,',
            'data:image/jpeg;base64,',
            'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAIAAAARCAIAAAB4lupGAAAABmJLR0QA/wD/AP+gvaeTAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAB3RJTUUH3AcNCCQqzSIL8QAAAF5JREFUCB0VwUEBAjEMRcHkJYWVjQkMcEcHNxSAACRkt80HZux2vXxeD2TGT+SITDJGjsFaSxK1H1U76DjhuGnOiTtSI1NLtFRVREBARJ63jVYTQdsfq3t1+/t5x/0LYfExwE/FbIYAAAAASUVORK5CYII=',
            'data:image/jpeg;base64,',
            'data:image/png;base64,',
            'data:image/png;base64,',
            'data:image/png;base64,'
        ];
        return "div#ui_bottomleft { \
            width: 232px; \
            position: absolute; \
            left: 0px; \
            bottom: 0px; \
            z-index: 15; \
        } \
        #ui_bottomleft.small-sized { \
            position: fixed; \
        } \
         \
        div#ui_chat { width: 232px; } \
        div#chat_loading { text-align: center; padding: 10px; } \
         \
        div#ui_chat > div.tabs { \
            position: relative; \
            background-image: url('" + images[0] + "'); \
            background-position: 0 0; \
            width: 232px; \
            height: 34px; \
            cursor: pointer; \
        } \
        div#ui_chat > div.tabs.friends { background-position: 0 -34px; } \
        div#ui_chat > div.tabs div.general, \
        div#ui_chat > div.tabs div.friends { \
            position: absolute; \
            font-weight: normal; \
            color: black; \
            width: 82px; \
            line-height: 20px; \
            margin-left: 25px; \
            top: 10px; \
            -webkit-user-select: none; \
            -moz-user-select: none; \
        } \
        div#ui_chat > div.tabs .active {  \
            color: white !important;  \
            font-weight: bold !important;  \
            line-height: 23px !important;  \
        } \
        div#ui_chat > div.tabs div.general { left: 5px; } \
        div#ui_chat > div.tabs div.general.active { left: 11px; } \
        div#ui_chat > div.tabs div.friends { left: 123px; } \
        div#ui_chat > div.tabs div.friends.active { left: 114px; } \
         \
        div#ui_chat div.container { width: 232px; background-image: url('" + images[1] + "'); z-index: 15; } \
        div#ui_chat div.container div.general, \
        div#ui_chat div.container div.friend { padding-left: 4px; position: relative; } \
        div#ui_chat div.container div.friend { display: none; } \
        div#ui_chat div.container div.friend div.chat_channel { height: 46px; } \
         \
        div#ui_chat div.container div.friend div.friend_client { position: relative; line-height: 19px; height: 42px; } \
        div#ui_chat div.container div.friend div.friend_details { margin: 0 0 0 50px; width: 120px; padding: 3px 0 0 0; overflow: hidden; } \
        div#ui_chat div.container div.friend div.friend_char { position: absolute; right: 12px; top: 1px; } \
        div#ui_chat div.container div.friend div.friend_char img { display: block; margin: 2px auto; } \
        div#ui_chat div.container div.friend div.friend_level {  \
            position: absolute; text-align: center; font-weight: bold;   \
            top: 28px; width: 41px; color: white; z-index: 2; \
            text-shadow: -1px 0 1px black, 0 1px 1px black, 1px 0 1px black, 0 -1px 1px black; \
        } \
        div#ui_chat div.container div.friend div.friend_avatar {  \
            position: absolute; left: 1px; top: 2px; width: 41px; height: 38px; overflow: hidden; } \
        div#ui_chat div.container div.friend div.friend_avatar div.friend_avatar_frame { \
            background: url('" + images[2] + "') no-repeat; \
            position: absolute; width: 41px; height: 38px; } \
         \
        div#ui_chat div.container div.friend div.friend_avatar div.friend_avatar_inner { \
            background: url('" + images[3] + "') no-repeat 11px 9px; \
            position: absolute; left: -8px; top: -7px; width: 46px; height: 43px; \
        } \
         \
        div#ui_chat div.container div.friend div.friend_avatar div.friend_avatar_inner img.old-avatar { \
            position: relative; left: 11px; top: 9px; width: 36px; height: 35px;	 \
        } \
         \
        div#ui_chat div.container div.friend .client_name { font-weight: bold; cursor: pointer; } \
        div#ui_chat div.container div.friend h2 { background: url('" + images[4] + "') no-repeat; font-size: 12px; letter-spacing: 1px; height: 19px; line-height: 18px; padding: 0 10px; cursor: pointer; } \
         \
        div#no_friends { text-align: center; margin: 6px; } \
         \
        div#ui_chat div.container img.loading { text-align: center;  } \
        div#ui_chat div.container div.tw2gui_scrollpane { max-height: 185px; width: 228px; } \
         \
        div#ui_chat div.container div.chat_channel { \
            height: 28px; \
            position: relative; \
            background: url('" + images[5] + "') no-repeat 2px bottom; \
            line-height: 24px; \
            vertical-align: middle; \
            padding-left: 5px; \
        } \
        div#ui_chat div.container img.leave_channel { \
            position: absolute; \
            cursor: pointer; \
            top: 5px; \
            right: 5px; \
        } \
        div#ui_chat div.container div.vertical_divider { \
            position: absolute; \
            display: inline-block; \
            left: 30px; \
            margin-top: 5px; \
            width: 2px; \
            height: 17px; \
            background-image: url('" + images[6] + "'); \
        } \
        div.chat_icons { \
            background: url('" + images[7] + "') no-repeat; \
            position: absolute; \
            top: 5px; \
            left: 8px; \
            width: 16px; \
            height: 16px; \
        } \
        div.chat_icons.white { background: url('" + images[8] + "') no-repeat; } \
        div.chat_icons.channelpic-county, \
        div.chat_icons.channelpic-game { background-position: 0 0; } \
        div.chat_icons.channelpic-town { background-position: -16px 0; } \
        div.chat_icons.channelpic-fortbattle { background-position: -32px 0; } \
        div.chat_icons.channelpic-maneuver { background-position: -48px 0; } \
        div.chat_icons.channelpic-alliance { background-position: -64px 0; } \
        div.chat_icons.channelpic-client, \
        div.chat_icons.channelpic-custom { background-position: -80px 0; } \
        div.chat_channel div.row_title, div.chat_channel > span { \
            position: absolute; \
            height: 20px; \
            left: 37px; \
            right: 80px; \
            cursor:pointer; \
            overflow: hidden; \
            text-overflow: ellipsis; \
            white-space: nowrap; \
        } \
        div.chat_channel > span { width: 180px; }  \
         \
        div.chat_channel div.online_count {  \
            position: absolute;  \
            background: url('" + images[9] + "') no-repeat center left; \
            width: 25px;  \
            right: 18px;  \
            height: 24px; \
            padding-left: 18px; \
            font-size: 8pt; \
        } \
        div.chat_channel .new_message { width: 12px; position: absolute; right: 62px; top: 8px; display: none; } \
        div.chat_channel .classimg { background-repeat: no-repeat; position: absolute; width: 20px; top: 5px; left: 6px; height: 16px; } \
         \
        div#servertime { \
            background: url('" + images[10] + "') no-repeat; \
            width: 224px; \
            height: 19px; \
            margin: 0 4px; \
            text-align: center; \
            font-weight: bold; \
            font-size: 11px; \
            line-height: 19px; \
        } \
         \
        .scripts.active_tab_id_fList .script_content dl dt { \
            float: left; \
            clear: left; \
            width: 100px; \
            padding-right: 1ex; \
            overflow: hidden; \
            white-space: nowrap; \
            text-overflow: ellipsis; \
        } \
        .scripts.active_tab_id_fList .script_content dl dt:after { content: ':'; } \
        .scripts.active_tab_id_fList .script_content dl dd { \
            float: left; \
            clear: right; \
        }";
    }

    function paintStyles() {
        var stylesheet = document.createElement('style');
        stylesheet.setAttribute('type', 'text/css');
        stylesheet.textContent = style();
        document.head.appendChild(stylesheet);
    }

    main();
})();